import React, { useState } from "react";
import {
  View,
  StyleSheet,
  RefreshControl,
  Text,
  Dimensions,
} from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import NewTab from "./components/NewTab";
import ListHeader from "./components/ListHeader";
import { SvgXml } from "react-native-svg";
import { FAB } from "react-native-paper";
import { getOtherServices } from "../../Class/service";
import { useSelector, useDispatch } from "react-redux";
import { ScrollView } from "react-native-gesture-handler";
import ServiceCart from "../../Cart/ServiceCart";
import ActivityLoader from "../../components/ActivityLoader";
import { textColor } from "../../assets/colors";
import { serverToLocal } from "../../Class/dataConverter";
import {
  SafeAreaView,
  useSafeAreaInsets,
} from "react-native-safe-area-context";
import { StatusBar } from "expo-status-bar";
const { width, height } = Dimensions.get("window");

const Tab = createMaterialTopTabNavigator();

const Stack = createStackNavigator();

export default function VendorServiceList({ navigation, route }) {
  const [initialState, setInitialState] = React.useState([
    {
      title: "Fixed",
      value: false,
      type: "ONETIME",
      name: "Fixed service",
    },
    {
      title: "Package",
      value: false,
      type: "PACKAGE",
      name: "Package",
    },
    // {
    //   title: "Subscription",
    //   value: false,
    //   type: "SUBS",
    // },
    // {
    //   title: "Installment",
    //   value: false,
    //   type: "INSTALLMENT",
    // },
  ]);
  const [Loader, setLoader] = React.useState(true);
  const [Data, setData] = React.useState([]);
  const offline = route.params.offline;
  const inset = useSafeAreaInsets();
  const [serviceCount, setServiceCount] = useState([0, 0]);

  // tabBar={(props) => <ListHeader {...props} />}
  return (
    <View
      style={{
        flex: 1,
       
      }}>
      <StatusBar style="dark" backgroundColor="#ffffff" />
      <View
        style={{
          height: inset?.top,
        }}
      />
      <Tab.Navigator
        screenOptions={{
          tabBarIndicatorStyle: {
            backgroundColor: "#767676",
            height: 3,
          },
          tabBarStyle: {
            backgroundColor: "#ffffff",
          },
          
        }}>
        {initialState.map((doc, i) => (
          <Tab.Screen
            options={{
              tabBarLabel: ({ focused, color }) => (
                <Text
                  style={{
                    fontWeight: "500",
                    fontSize: 16,

                    color: focused ? "#000000" : "#A3A3A3",
                  }}>
                  {`${initialState[i].name} `}
                  <Text
                    style={{
                      fontSize: 12,
                    }}>
                    {serviceCount[i]}
                  </Text>
                </Text>
              ),
            }}
            key={i}
            name={doc.title}
            initialParams={{
              key: doc.type,
              userId: route.params.userId,
              offline: offline,
              setServiceCount: setServiceCount,
              index: i,
            }}
            component={Screens}
          />
        ))}
      </Tab.Navigator>
    </View>
  );
}
const wait = (timeout) => {
  return new Promise((resolve) => setTimeout(resolve, timeout));
};
const Screens = ({ navigation, route }) => {
  const [Data, setData] = React.useState();
  const [Loader, setLoader] = React.useState(true);
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const [refreshing, setRefreshing] = React.useState(false);
  const dispatch = useDispatch();
  const userId = route.params.userId;
  const offline = route.params.offline;
  const setServiceCount = route?.params?.setServiceCount;
  const index = route?.params?.index;
  //console.log(userId)
  const onRefresh = React.useCallback(() => {
    setRefreshing(true);
    wait(2000).then(() => setRefreshing(false));
  }, []);
  React.useEffect(() => {
    //console.log(route)
    getOtherServices(user.token, vendor.service.id, route.params.key)
      .then((res) => {
        setData(res.data.gigs);
        setServiceCount((v) =>
          v.map((doc, i) => {
            if (i == index) {
              return res.data.gigs.length;
            } else {
              return doc;
            }
          })
        );
        //console.log(res.data)
        setLoader(false);
      })
      .catch((err) => {
        console.warn(err.response.data.msg);
        setLoader(false);
      });
  }, [refreshing]);
  if (Loader) {
    return <ActivityLoader />;
  }
  

  if (!Data) {
    return (
      <View
        style={{
          flex: 1,
          alignItems: "center",
          justifyContent: "center",
        }}>
        <SvgXml xml={emptyIcon} width="80%" />
        <FAB
          color="#FFFFFF"
          icon="plus"
          style={{
            position: "absolute",
            borderRadius: 30,
            backgroundColor: "#43B05C",
            bottom: 40,
            right: 20,
            width: 50,
            height: 50,
            justifyContent: "center",
            alignItems: "center",
          }}
          onPress={() => {
            dispatch({ type: "SET_LIST_SELECTION", playload: [] });
            if (vendor.service.gigs[0].services.category) {
              dispatch({
                type: "SET_NEW_LIST_DATA",
                playload: serverToLocal(
                  vendor.service.gigs[0].services.options,
                  vendor.service.gigs[0].services.category
                ),
              });
              navigation.navigate("AddServiceList_1", {
                NewDataList: serverToLocal(
                  vendor.service.gigs[0].services.options,
                  vendor.service.gigs[0].services.category
                ),
                name: "VendorOrderDetails",
                data: "ONETIME",
              });
            } else {
              dispatch({
                type: "SET_NEW_LIST_DATA",
                playload: serverToLocal(
                  vendor.service.gigs[0].services,
                  vendor.service.gigs[0].dashboard
                ),
              });
              navigation.navigate("AddServiceList_1", {
                NewDataList: serverToLocal(
                  vendor.service.gigs[0].services,
                  vendor.service.gigs[0].dashboard
                ),
                name: "VendorOrderDetails",
                data: "ONETIME",
              });
            }
          }}
        />
      </View>
    );
  }
  return (
    <ScrollView
      refreshControl={
        <RefreshControl refreshing={refreshing} onRefresh={onRefresh} />
      }
      showsVerticalScrollIndicator={false}>
      <Text
        style={{
          fontSize: 24,

          fontWeight: "600",
          marginHorizontal: 20,
          marginVertical: 16,
          marginTop: 32,

        }}>
        Select Service
      </Text>
      <View
        style={{
          flexDirection: "row",
          flexWrap: "wrap",
          paddingHorizontal: 12,
        }}>
        {Data.map((doc, i) => (
          <ServiceCart
            onPress={() => {
              if (
                doc.type == "ONETIME" ||
                doc.type == "SUBS" ||
                doc.type == "INSTALLMENT"
              ) {
                navigation.navigate("SelectDate", {
                  data: doc,
                  userId: userId,
                  offline: offline,
                });
              } else if (doc.type == "PACKAGE") {
                navigation.navigate("PackageList", {
                  data: doc,
                  userId: userId,
                  offline: offline,
                });
              }
              //console.log(doc.type)
              //navigation.navigate("SelectDate",{data:doc,userId:userId})
            }}
            key={i}
            data={doc}
          />
        ))}
      </View>
      <View style={{ height: 20 }} />
    </ScrollView>
  );
};
